INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (222,'066','염행의 친일몰몰한 바다의 바람만큼 외로운 독대와 같습니다. 그렇다고 부당한 일을 향해 이루려고 하면 해가 있겠습니다. 적막한 천지에 처지니 인간세상에서 그 고독을 누가 가늠하겠습니까. 새로운 뜻을 품어 일을 이루려 노력하면 길하겠습니다. 친구와 선배를 가까이 하십시오. 그러면 길하겠습니다. 그러나 만일 주색을 가까이 하면 반드시 후회가 있겠습니다. 금년의 운수는 성공하기 어려운 운으로 방황하던 개가 달을 짖다 놓치는 격입니다. 본사이 몸을 친척할 수 있어 질병의 두려움이 있고 초월은 이득이 있을 것 같아 가까이 하지만 도리어 해가 되는 액운이 있습니다. 특히 북방을 조심하는게 좋겠습니다. 남의 뒤는 복이 되는 것도 자신이 답볍 때는 흉이 되어 돌아오기 때문입니다.','신수가 좋지 않아 혹 다른 곳으로 이동하려 해도 액을 면하기 어렵겠습니다. 친한 사람으로부터 시기를 당하게 되어 하려는 일에도 해가 있겠습니다. 만일 집에 근심이 없으면 부모상을 당하거나 부모의 액으로 인해 무로움을 당하겠습니다.','의식이 부족하니 매사에 만족함이 없겠습니다. 이루어 보려는 마음은 있으나 액이 넘어 꿋꿋한 대로 이루기는 어려울 것입니다. 스스로 자탄하며 무로워한들 그러한 걸 어찌하겠습니까. 남으로 인해 패할 일이 있으니 함께 일하지 마십시오.','근심이 꿈치지 않으니 바를 이루지 못하겠습니다. 집에는 질고가 있어 마음이 편안하지 못하겠습니다. 마음을 달래려고 집을 떠나 밖으로 나가려하면 또 다른 운물이 도사리고 있게될 운입니다. 밖에는 이익 될 일이 없으니 집을 지키며 인내하는 것이 좋겠습니다.','우연히 시작한 일에 재물이 들어올니다. 물에서 이익을 찾으려 하면 흉함상이고 잘지에서 복록을 구하면 꿋꿋한 대로 이루어지겠습니다. 그러나 바라던 일을 이루려 해도 들어온 이익이 모자라는 감이 있겠습니다.','액운을 넘기고 새로운 사업을 하려하나 집에 다시 근심이 생기기 시작합니다. 성급히 이루려고 큰 것을 탐하다 도리어 해가 따르겠습니다. 작은 것을 바라고 내실을 꿋꿋하는 게 뜻이 됩니다. 재물이 흐려져 구름과 같으리니 뒤늦게 후회한들 무슨 소용이 있겠습니까.','달이 구름 불어 나듯 액운을 물리치고 밝은 빛을 찾기가 어려운 운세입니다. 다른 사람을 믿지 마십시오. 서로 시기하여 마음을 상하게 되고 재물로 다투겠습니다. 연인을 가까이 하는 것도 좋지 않습니다. 만일 이를 어기면 질병이 몸을 치겠습니다.','입을 무겁게 하고 사람을 사귀십시오. 경몰되이 행동하면 구설을 면하기 어렵겠습니다. 주색을 가까이 하면 손재가 있으니 남 것을 잃고 후회하게 됩니다. 남과 사귀는 데 있어서는 양보하고 참는 게 좋겠습니다. 송사를 치르거나 시비할 수 있습니다.','사람이 모여 서로 도우며 사는 게 세상사인데 남들과 불화하며 일을 구하려 하니 되는 일이 없겠습니다 목성을 가까이 하면 해가 있으니 조심하십시오. 운물으로 인해 마음에 걱정이 떠나지 않을 운입니다. 미리 불측에 다가가 기도하는 게 좋겠습니다.','남과 북쪽에 불리한 운이 있으니 가지 않는 게 좋습니다. 바라던 일을 이루지 못하겠습니다. 단 서쪽에는 재물이 있어 그곳으로 가면 조금은 얻겠습니다. 집안에 흉한 운물이 발동하겠으니 미리 명산을 찾아가 마음을 정결히 하고 기도하면 면하게 될 것입니다.','마음을 모아 이를 이루려 하나 세상일에 협력한 마음만 남겠습니다. 손재가 없으면 집안에 근심이 있으며 배우자에게 운물이 닥칠 수 있겠습니다. 그러나 한 것이 다하면 단 것이 온는 법. 갑자기 운 보람이 있어 마침내 형통함을 보겠습니다.','영기가 발동하니 물과 불을 조심하십시오. 남쪽과 북쪽으로 가지 마십시오. 별로 큰 소득을 얻지 못하겠습니다. 자신이 해야할 도리를 지키고 어김없 없이 일하게 되면 조금이나마 이익이 오고 액운에서 피할 수 있게 될 것입니다.','백설이 쌓인 곳에서 어찌 형근 잎을 튀울 수 있겠습니까. 마음만으로 일을 꿋꿋하나 이루지 못해 가슴만 앓는 격입니다. 먼 곳으로 가게 되면 후앙이 두려우니 가지 않는 게 좋겠습니다. 소망을 이루지 못하고 제자리만 지키려니 마음만 산란한 운수입니다.','2025-03-02 12:02:36.066446+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (435,'066','这就像一种孤独的毒药，就像大海一样孤独。但是，如果您试图实现不公平的事情，那将是有害的。谁会在人类世界中权衡这种孤独感，因为它在一个安静的天地中下垂？如果我们试图以新的遗嘱来实现工作，我们将会很长。请关闭您的朋友和高年级。那我会这样长。但是，如果您接近主要颜色，您会后悔的。今年的运气很难成功，徘徊的狗错过了月亮。人们担心这种疾病，因为它可能是相对亲戚，而且超越似乎是有益的。注意北部特别好。在别人后面的祝福是因为他们回答时会回到胸前。','即使您试图搬到其他地方，也很难避免液体，因为新水不好。羡慕一个亲密的人也是有害的。如果您不在家里担心，您将渴望父母或父母的液体。','意识没有足够的意识，因此所有事物都不会满意。我有实现的愿望，但是很难实现它，因为它超越了液体。你想让我做什么？不要一起工作，因为由于别人而失去了一些东西。','我不必担心，所以我无法达到标准。家里有韧性，所以我感到不舒服。如果您离开房子，出去舒缓您的想法，另一个水潜伏。外部没有任何好处，因此最好保留您的房屋。','财富偶然发生了。如果您尝试在水中找到利润，那将是丑陋的。但是，即使您尝试实现自己想要的东西，也可能缺乏利润。','我尝试为运气开展新业务，但我再次担心。我将垂涎这么大的事情。这意味着您想做些小事并建造自己的房间。由于财富模糊并且像云一样，后悔晚期的用途是什么？','这是一个很难击败运气并在月亮吹来时找到明亮光的财富。不要相信别人。我们将互相羡慕，我们将因财富而伤害我们的心和吵架。接近爱人是不好的。如果您打破它，这种疾病将击中您的身体。','使你的嘴变得沉重，使人成为人。如果这样做，很难避免构造。如果您接近主要颜色，则具有灵巧性，因此您会失去其他人并后悔。最好给约会和忍受约会。您可以玩耍或施肥。','这是人们聚集在一起互相帮助的世界历史。由于水，我不会担心它。最好事先与之祈祷。','南部和北部都有缺点，所以不要去。我无法实现我想要的。但是，西方有财富，所以如果您去那里，我会得到一点。房子里会有丑陋的水，因此，如果您提前去Myeongsan，您将能够避免。','我会竭尽全力实现这一目标，但我只会在世界上共同努力。没有敏捷，您会担心房子，您的配偶可能会来。但是，如果这样做，那是一件甜蜜的事情。突然有一个奖励，所以让我们终于看到繁荣。','当精神被激活时，请注意水和火。不要向南和向北。我不会赚很多收入。如果您保持自己的工作和工作，您将能够获利并避免它。','如何在积雪堆积的地方炸叶？我无法独自一人做我的工作。如果您去一个遥远的地方，那么您不应该害怕黄。幸运的是，保持无希望的地方。','2025-03-02 12:02:36.066446+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (506,'066','それは海の風と同じくらい孤独な孤独な毒のようなものです。しかし、不公平なことのためにそれを達成しようとすると、それは有害です。それが静かな天と地で垂れ下がっているので、誰が人間の世界でその孤独の重さを量るでしょうか？新しい意志で仕事を達成しようとするなら、私たちは長くなります。友達と先輩を閉じてください。それから私はそれを長くします。しかし、メイン色に近づくと、後悔するでしょう。今年の運は大変な成功した運であり、犬がさまよう犬は月を逃しています。病気は比較的親relativeである可能性があり、超越が有益であるため、この病気への恐怖があります。北に注意するのは特に良いことです。他の人の背後にある祝福は、彼らが答えるときに胸のように戻ってくるからです。','新しい水が良くないため、他の場所に移動しようとしても、液体を避けることは困難です。また、親しい人からうらやましいことは有害です。あなたが家で心配していないなら、あなたはあなたの親やあなたの両親の液体に熱心になります。','十分な意識がないので、すべてに満足することはありません。私は達成したいと思っていますが、液体を超えているので、達成することは困難です。あなたは何をしたいですか？他の人のために失うものがあるので、一緒に働かないでください。','心配する必要はないので、バーを達成できません。家にはタフネスがあるので、私は快適に感じることができません。あなたが家を出て、あなたの心を落ち着かせるために出かけると、別の水が潜んでいます。外部から利益を得るものは何もないので、あなたの家を維持する方が良いです。','富は偶然に起こったことに来ます。水中で利益を見つけようとすると、醜いでしょう。しかし、あなたが望むことを達成しようとしたとしても、あなたは利益が不足しているかもしれません。','私は幸運を抱えて新しいビジネスをしようとしていますが、私は再びそれを心配しています。私は達成するために大きなことを切望します。それはあなたが小さなことをして、あなた自身の部屋を作りたいことを意味します。富はぼやけて雲のようになっているので、後悔の使用は何ですか？','それは、月が吹くにつれて運を打ち負かし、明るい光を見つけるのが難しい幸運です。他の人を信じないでください。私たちはお互いにうらやましくなり、心を傷つけ、富で口論します。あなたの恋人に近づくのは良くありません。あなたがそれを壊すと、病気はあなたの体にぶつかります。','口を重くして人を作ってください。これを行うと、建設を避けることは困難です。メイン色に近づくと、器用さがあるので、他の人を失い、後悔します。譲歩し、デートに耐える方が良いです。プレイまたは施肥することができます。','人々が集まり、お互いを助けるために集まっているのは世界の歴史です。水のために心配しません。事前にアプローチして祈る方が良いです。','南と北には欠点があるので、行かないでください。私は自分が欲しかったことを達成できません。しかし、西側には富があるので、そこに行くと少し手に入れるでしょう。家には醜い水があるので、事前にミオンサンに行くと、それを避けることができます。','私はそれを達成するために私の心を思いつきますが、私は世界でのみ一緒に働きます。器用さがなければ、あなたは家を心配しており、あなたの配偶者が来ることができます。しかし、もしあなたがそれをするなら、それは来るのは甘いことです。突然報酬があるので、ついに繁栄を見てみましょう。','精神が活性化されるので、水と火に注意してください。南と北に行かないでください。私はあまり収入を得ません。自分で仕事をして仕事をしていると、少し利益を得て避けることができます。','雪が積まれている場所で葉をどのように揚げることができますか？私は自分の心だけで自分の仕事を達成することはできません。あなたが遠い場所に行くならば、あなたはハンを恐れるべきではありません。希望なしに所定の位置に保つことは幸運なことです。','2025-03-02 12:02:36.066446+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (364,'066','It is like a lonely poison that is as lonely as the wind of the sea. But if you try to achieve it for unfair things, it will be harmful. Who will weigh that loneliness in the human world because it''s sagging in a quiet heaven and earth? We will be long if we try to achieve work with a new will. Please close your friend and senior. Then I will do it long. But if you get close to the main color, you will be regretted. This year''s luck is a hard -to -succeeded luck, and the dog wandering around is missing the moon. There is a fear of the disease because it can be relatively relatives, and the transcendence seems to be beneficial. It is especially good to watch out for the north. Blessing behind others is because they come back as a chest when they answer.','It is difficult to avoid the liquid even if you try to move to other places because the new water is not good. It is also harmful to be envious from a close person. If you are not worried at home, you will be eager for your parent or your parents'' liquid.','There is not enough consciousness, so there will be no satisfaction with everything. I have a desire to achieve, but it will be difficult to achieve it as it is beyond the liquid. What do you want to do? Do not work together because there is something to lose because of others.','I don''t have to worry, so I can''t achieve the bar. There is a toughness at home, so I can''t feel comfortable. If you leave the house and go out to soothe your mind, another water will be lurking. There is nothing to benefit from outside, so it is better to keep your home.','Riches come to what happened by chance. If you try to find profits in the water, it will be ugly. But even if you try to achieve what you want, you may have a lack of profit.','I try to do a new business over the luck, but I am worried about it again. I will covet the big thing to accomplish. It means that you want to do small things and make your own room. What is the use of regret late because the wealth is blurred and like a cloud?','It is a fortune that is difficult to defeat the luck and find bright light as the moon blows. Do not believe others. We will be envious of each other and we will hurt our hearts and quarrel with wealth. It''s not good to get close to your lover. If you break it, the disease will hit your body.','Make your mouth heavy and make people. If you do this, it will be difficult to avoid the construction. If you get close to the main color, you have a dexterity, so you will lose others and regret it. It is better to give concessions and endure in dating. You can play or fertilize.','It is a world history that people gather together to help each other. I won''t worry about it because of the water. It is better to approach it in advance and pray.','There are disadvantages in the south and north, so don''t go. I can''t achieve what I wanted. However, there is a wealth in the west, so if you go there, I will get a little. There will be ugly water in the house, so if you go to Myeongsan in advance, you will be able to avoid it.','I will come up with my heart to achieve it, but I will only work together on the world. Without dexterity, you are worried about the house and your spouse can come. But if you do it, it''s a sweet thing to come. Suddenly there is a reward, so let''s finally see the prosperity.','Be careful of water and fire as the spirit is activated. Do not go south and north. I will not earn much income. If you keep your own and work, you will be able to get a little profit and avoid it.','How can you fry the leaves in the place where the snow is piled up? I can''t achieve my work with my heart alone. If you go to a distant place, you should not be afraid of Huang. It is a lucky luck to keep in place without hope.','2025-03-02 12:02:36.066446+00','e');
